INSERT INTO `sites` VALUES (1,'Center Line Services',724,1,'Offer Land Survey, Construction Staking, and Drafting to Las Cruces, NM and the surrounding areas.','Founded in 2006 by Anthony Gutierrez and Loren Kuehne, one of Center Line\'s goals was to offer survey needs at an affordable rate with timely turnaround.  Shortly after it was founded Center Line realized that they needed to offer a more efficient way of ordering and tracking surveys on-line.  They did this by employing the skills of John Willis, a talented local programmer, to design a website capable of offering an online tracking and ordering service.  Since then, Center Line Services has applied for a patent for the web based application Prefiniti, and has been featured in American Surveyor for their on-line service.\n\nCRS# 03-073784-00-2',1,'logo.png','We do the best we can with all that we have.','To become better than we were a year ago and help others do the same.','Service: It\'s more than just our name',1,NULL,NULL,7.4375),(5,'Prefiniti',724,1,'Prefiniti is a comprehensive business management and social networking tool developed to help companies gain an edge in a market place with standards that are driven by larger corporations.','<p>Prefiniti is a new type of web-based software developed by the owner of a land survey company in Las Cruces, New Mexico, and his friend in software design. Our first product was a basic web-based ordering system created in one afternoon for  the survey firm. From that beginning, Prefiniti evolved into its present form.</p>\r\n<p>Prefiniti provides business owners and their employees the opportunity to work more efficiently, allowing them to reach their full potential. Our pledge is to make that as easy as possible.</p>',7,'prefiniti-small.png','','','Many problems... one solution.',1,NULL,NULL,0),(6,'Test Site',724,1,'','',3,'testsite.png','','','',1,NULL,NULL,7.125),(7,'Bell Surveying & Mapping',725,1,NULL,NULL,1,'bellsurv.png',NULL,NULL,NULL,NULL,NULL,NULL,0),(8,'Children\'s Wellness Center',782,1,'','Children\'s Health Care, Pediatrics, Pediatrician, Immunizations for Children, Newborn Wellness',2,'childwell.png','','','',4,NULL,NULL,0),(11,'G\'s Drafting',725,1,'Provides Civil and Land Survey drafting services.','G\'s Drafting is a Las Cruces, NM-based drafting service providing services to businesses in the Civil Engineering and Land Survey industries.',8,'gsdrafting.png','','','',NULL,'6B913EBC-19B9-CB32-B721A1B1498D4B3E',NULL,0),(12,'Pacheco Development, LLC',794,1,'Providing Civil Engineering services to Las Cruces, NM','',9,'pachecodvlptmnt.png','','','',NULL,'6F27557F-19B9-CB32-B760731E05AE2C03',NULL,0),(15,'Roberto Brizuela & Associates, Inc',725,1,'Land Survey',NULL,1,NULL,NULL,NULL,NULL,NULL,'6F90D89B-19B9-CB32-B7B9AD72239117CA',NULL,0),(16,'Jingle Crafters',732,1,'','We are a professionally trained musicians providing high-quality, long-lasting memorable jingles to help you cut through the ad-clutter on the radio or tv, save you money and get your name, slogan and major selling points stuck in your clients heads.',10,NULL,'We aim to provide high-quality, memorable jingles that will increase your business.','','',NULL,'70C8A76B-19B9-CB32-B7CEE9E66F349D38',NULL,0),(17,'Accent Woodwork',725,1,NULL,NULL,13,NULL,NULL,NULL,NULL,NULL,'A2B5E9D5-19B9-CB32-B735C30417C4276A',NULL,0),(18,'The Rain Forest',725,1,'The Rain Forest',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0),(19,'Coherent Logic Development',724,1,'','',7,NULL,'','','Solutions//Everywhere',NULL,'4B21C5DD-19B9-CB32-B7688C5B25A9511E',NULL,0),(20,'Geodigraph',725,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0),(21,'Test Site',724,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'9682B0D9-5D11-4F52-8BBBA01C35C349F8',NULL,0),(22,'Wally\'s Wacky Widgets',724,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4514ECBB-A88B-4A7D-B72064F7B31A3AB7',NULL,0),(23,'Johnny\'s Jump-Ups',724,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'533D13B7-C407-4BFA-9730802DB9A5B23C',NULL,0),(24,'F